    return(
        <div>
            <div className="imgdiv">
                <img src={Giffy} width="200px" ></img>
                <div class="container">
                    <div class="row">
                        <div class="neons col-12">
                            <h1><em>-feelin' blue-</em></h1>
                        </div>
                    </div>
                </div>
                <img src={Mypic} className="Mypic"></img>
            </div>

            <div className="secdiv">
                <h1>About Be</h1>
                <h1>Areas Of Expertise</h1>
            </div>

        </div>
    )
}

export default Header;
